import React from 'react';
import { Link, useNavigate } from 'react-router-dom';
import './Menu.css';

const Menu = ({ loggedIn, handleLogout }) => {
  const navigate = useNavigate();

  const handleLogoutClick = () => {
    handleLogout();
    navigate('/login');
  };

  return (
    // Rozmieszczamy warunkowe renderowanie wewnątrz zwracanego elementu JSX
    loggedIn && (
      <div className="menu">
        <ul className="menu-links">
          <li className="menu-link"><Link to="/">Strona główna</Link></li>
          <li className="menu-link"><Link to="/calendar">Calendar</Link></li>
          <li><button className="menu-link" onClick={handleLogoutClick}>Wyloguj</button></li>
        </ul>
      </div>
    )
  );
};

export default Menu;
